// src/csvTemplates.js
export const templates = {
  rapsodo: {
    "BallSpeed": "ball_speed",
    "LaunchAngle": "launch_angle",
    "SpinRate": "spin_rate",
    "CarryDistance": "carry_distance",
    // add other known headers
  },
  gspro: {
    "BallSpeed": "ball_speed",
    "LaunchAngle": "launch_angle",
    "Spin": "spin_rate",
    "Carry": "carry_distance",
    // update this as actual exports appear
